private writeFunctionDeclaration(func: Function, realm: Realm, indexer: string = '.') {
  let declaration = `function ${func.parent ? `${func.parent}${indexer}` : ''}${GluaApiWriter.safeName(func.name)}(`;

    if (func.arguments) {
